import React from "react";
import { Link } from "react-router-dom"
import * as S from "./style"

export default function MyProjects() {
    return (
        <>
            <S.Home>
                <Link to="/">Home</Link>
            </S.Home>
            <h1>Meus Projetos</h1>
        </>
    )
}
